import React from 'react';
import './App.css';
import Header from './components/header';

function App() {
  return (
    <body className="body">
      <div className="App-header">
          <Header></Header>
      </div>
      <div style="color: black; height: 222px;"></div>
    </body>
  );
}

export default App;
